pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./proof/Dealer.sol";
import "./proof/Player.sol";
import "./interfaces/IPrice.sol";
import "./interfaces/IPool.sol";
import "./interfaces/ISettings.sol";
import "./interfaces/IPoolCallback.sol";
import "./libraries/PrecisionMath.sol";

/**
    创建池子后：
        设置dealer地址
        设置palyer地址
        id绑定池子与创建者的关系,通过dealerToPlayer确定哪个index的玩家可以参与池子

    玩法：
        player提交开仓请求（submit）：
            一个1155只能提交一次请求----通过地址控制
            waitPositions记录等待仓位
        dealer统一开仓（open）：
            只能操作一次----deadline为0时可操作
            提交同时设置deadline,deadline需大于当前区块时间
            清空waitPositions
        平仓清算：
            只有结束后参与者可操作
 */
contract Pool is IPool, Ownable {

    using SafeERC20 for IERC20;
    using SafeMath for uint256;
    using PrecisionMath for uint256;

    //nft address
    address public player;
    address public dealer;

    //721 id
    uint256 public id;

    //pool new param
    uint256 public deadLine;
    //TODO 价格获取方式,结束时的喂价方式
    uint256 public beginPrice;
    uint256 public endPrice;
    mapping(address => uint256) userToTimes;

    // 底池币
    address public payToken;
    // 可支持杠杆
    mapping(int16 => bool) public override levels;
    // 保证金率
    uint256 public marginRatio;
    // 协议费率
    uint256 public protocolFee;
    // 清算协议费率
    uint256 public liqProtocolFee;
    // 协议费率接受人
    address public protocolReceipt;

    address private _priceAddr;

    // 等待仓位index
    uint32 public waitIndex = 0;
    // 仓位index
    uint32 public index = 0;
    // 交易对上次更新价格
    uint256 public lastPrice = 0;

    // 总仓位
    uint256 public totalPosition;

    // 多头合并仓位
    MergedLong public override mergedLong;
    // 空头合并仓位
    MergedShort public override mergedShort;
    // 等待仓位列表
    mapping(uint32 => WaitPosition) public waitPositions;
    // 仓位列表
    mapping(uint32 => Position) public override positions;

    int256 private constant E18 = 1e18;
    uint256 private constant MAX_UINT256 = 0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;

    bool private locked;

    constructor(address payToken_, address oracle_, bool reverse_, uint8 typ, uint256 id_, address dealer_, address player_) {
        dealer = dealer_;
        player = player_;

        id = id_;
        payToken = payToken_;

        ISettings setting = ISettings(msg.sender);
        _priceAddr = setting.priceAddress();
        IPrice(_priceAddr).setPool(oracle_, typ, reverse_);

        mergedLong = MergedLong(0, 0, IPrice(_priceAddr).getPrice(), 0);
        mergedShort = MergedShort(0, 0, 0, IPrice(_priceAddr).getPrice(), 0);

        marginRatio = setting.marginRatio();
        protocolFee = setting.protocolFee();
        liqProtocolFee = setting.liqProtocolFee();
        protocolReceipt = setting.protocolReceipt();

        emit SetMarginRatio(marginRatio);
        emit SetProtocolFee(protocolFee);
        emit SetLiqProtocolFee(liqProtocolFee);
    }

    function getPoolType() public returns (bool) {
        return block.timestamp <= deadLine;
    }

    function addLevel(uint16 level) external onlyOwner {
        levels[int16(level)] = true;
        levels[-int16(level)] = true;
        emit AddLevel(level);
    }

    function removeLevel(uint16 level) external onlyOwner {
        levels[int16(level)] = false;
        levels[-int16(level)] = false;
        emit RemoveLevel(level);
    }

    function getPrice() external override view returns (uint256) {
        return IPrice(_priceAddr).getPrice();
    }

    function lpPrice() external view returns (uint256) {
        return _lpPrice();
    }

    function _lpPrice() internal view returns (uint256) {
        if (mergedLong.lp.add(mergedShort.lp.mul(2).sub(mergedShort.fakeLp)) == 0) {
            return 1e18;
        }

        return totalPosition.fdiv(mergedLong.lp.add(mergedShort.lp.mul(2).sub(mergedShort.fakeLp)));
    }

    function poolCallback(address user, uint256 amount) internal lock {
        uint256 balanceBefore = IERC20(payToken).balanceOf(address(this));
        IPoolCallback(msg.sender).poolCallback(
            amount,
            payToken,
            user
        );
        require(
            IERC20(payToken).balanceOf(address(this)) >=
            balanceBefore.add(amount),
            "PT Err"
        );
    }

    function submit(address user, uint256 margin, int16 level) external override onlyPlayer(user) {
        require(deadLine == 0, "Pool has been begun");
        require(userToTimes[user] < Player(player).balanceOf(user, Player(player).dealerToPlayer(id)), "you have opened");
        waitIndex++;
        waitPositions[waitIndex] = WaitPosition(
            msg.sender,
            user,
            level,
            margin
        );
        userToTimes[user]++;
    }

    function open(address user, uint256 deadLine_) external override onlyDealer(user) {
        require(deadLine == 0, "Pool has been begun");
        require(deadLine_ > block.timestamp, "deadline too early");

        deadLine == deadLine_;
        Dealer(dealer).setDealerToDeadline(id, deadLine_);
        for (uint32 i = 1; i <= index; i++) {
            _open(
                waitPositions[i].router, 
                waitPositions[i].user, 
                waitPositions[i].asset, 
                waitPositions[i].level
            );
        }
        // delete waitPositions;
        Dealer(dealer).setDealerType(id, 0);

        emit Deadline(deadLine);
    }

    // 开仓 杠杆可标识正反向
    function _open(address router, address user, uint256 margin, int16 level) internal returns (uint256) {
        require(levels[level], "level Err");
        require(margin > 0, "margin Err");
        poolCallback(user, margin);

        uint256 price = IPrice(_priceAddr).getPriceAndUpdate();
        beginPrice = price;
        _rebase(price);
        index++;

        uint256 position = level > 0? margin.mul(uint256(int256(level))): margin.mul(uint256(int256(-level)));
        uint256 lp = position.fdiv(_lpPrice());

        positions[index] = Position(
            router,
            user,
            level,
            position,
            lp,
            price
        );

        if (level > 0) {

            mergedLong.openPrice = price;
            mergedLong.asset = mergedLong.asset.add(position);
            mergedLong.lp = mergedLong.lp.add(lp);
            mergedLong.openLp = mergedLong.lp;

        } else {

            mergedShort.openPrice = price;
            mergedShort.asset = mergedShort.asset.add(position);
            mergedShort.fakeLp = mergedShort.fakeLp.add(lp);
            mergedShort.lp = mergedShort.lp.add(lp);
            mergedShort.openLp = mergedShort.fakeLp;

        }

        totalPosition = totalPosition.add(position);

        emit Open(index, user, margin, lp, price, level);
        return index;
    }

    // 平仓
    function close(uint32 index, address user, address receipt) external override onlyPlayer(user) {
        require(!getPoolType(), "Pool is going");
        Position memory p = positions[index];
        require(p.router == msg.sender, "router Err");
        require(p.user == user, "user Err");

        uint256 price = endPrice;
        _rebase(price);

        uint256 tmpLp = price.fdiv(p.openPrice).fmul(p.lp);
        uint256 margin = p.asset.div(p.level > 0? uint256(int256(p.level)): uint256(int256(-p.level)));
        uint256 receivePosition;

        if (p.level > 0) {
            receivePosition = tmpLp.fmul(_lpPrice());
        } else {
            receivePosition = (p.lp.mul(2).sub(tmpLp)).fmul(_lpPrice());
        }

        uint256 fee = receivePosition.fmul(protocolFee);

        require(receivePosition.add(margin) > p.asset.add(margin.fmul(marginRatio)).add(fee), "in liquidation");

        if (p.level > 0) {

            if (mergedLong.lp < tmpLp) {
                tmpLp = mergedLong.lp;
            }
            mergedLong.lp = mergedLong.lp.sub(tmpLp);
            mergedLong.openPrice = price;
            mergedLong.asset = mergedLong.asset.sub(p.asset);
            mergedLong.openLp = mergedLong.lp;

        } else {

            if (mergedShort.fakeLp < tmpLp) {
                tmpLp = mergedShort.fakeLp;
            }

            mergedShort.openPrice = price;
            mergedShort.asset = mergedShort.asset.sub(p.asset);
            mergedShort.fakeLp = mergedShort.fakeLp.sub(tmpLp);
            mergedShort.lp = mergedShort.lp.sub(p.lp);
            mergedShort.openLp = mergedShort.fakeLp;

        }

        if (totalPosition < receivePosition) {
            receivePosition = totalPosition;
        }

        totalPosition = totalPosition.sub(receivePosition);

        uint256 transferOut = receivePosition.add(margin).sub(p.asset);
        uint256 payTokenBalance = IERC20(payToken).balanceOf(address(this));
        if (payTokenBalance < transferOut) {
            transferOut = payTokenBalance;
        }

        if (protocolFee > 0) {
            IERC20(payToken).safeTransfer(receipt, transferOut.sub(fee));
            // 剩下的钱 给协议费率接受人
            IERC20(payToken).safeTransfer(protocolReceipt, fee);
        } else {
            IERC20(payToken).safeTransfer(receipt, transferOut);
        }

        emit Close(index, p.user, tmpLp, receivePosition, price, fee);
        delete positions[index];
    }

    // 清算
    function liquidate(address user, uint32 index, address receipt) external override onlyPlayer(user) {
        require(!getPoolType(), "Pool is going");
        Position memory p = positions[index];
        require(p.asset > 0, "liq Err");

        uint256 price = endPrice;
        (uint256 liqPrice, uint256 margin) = _calLiqPrice(p);

        require(liqPrice != MAX_UINT256, "liquidation fail");

        if (liqPrice == 0) {
            // 异常情况
            liqPrice = price;
        } else {
            require((liqPrice > price) == (p.level > 0), "liquidation fail");
        }

        _rebase(liqPrice);

        uint256 tmpLp = liqPrice.fdiv(p.openPrice).fmul(p.lp);
        uint256 receivePosition;
        if (p.level > 0) {
            receivePosition = tmpLp.fmul(_lpPrice());
        } else {
            receivePosition = (p.lp.mul(2).sub(tmpLp)).fmul(_lpPrice());
        }

        if (p.level > 0) {

            if (mergedLong.lp < tmpLp) {
                tmpLp = mergedLong.lp;
            }

            mergedLong.openPrice = liqPrice;
            mergedLong.asset = mergedLong.asset.sub(p.asset);
            mergedLong.lp = mergedLong.lp.sub(tmpLp);
            mergedLong.openLp = mergedLong.lp;

        } else {

            if (mergedShort.fakeLp < tmpLp) {
                tmpLp = mergedShort.fakeLp;
            }

            mergedShort.openPrice = liqPrice;
            mergedShort.asset = mergedShort.asset.sub(p.asset);
            mergedShort.fakeLp = mergedShort.fakeLp.sub(tmpLp);
            mergedShort.lp = mergedShort.lp.sub(p.lp);
            mergedShort.openLp = mergedShort.fakeLp;

        }

        if (totalPosition < receivePosition) {
            receivePosition = totalPosition;
        }

        totalPosition = totalPosition.sub(receivePosition);
        uint256 payTokenBalance = IERC20(payToken).balanceOf(address(this));
        uint256 liqReward = margin.fmul(marginRatio);
        uint256 fee;

        if (liqProtocolFee > 0) {
            if (payTokenBalance < liqReward) {
                liqReward = payTokenBalance;
            }

            fee = liqReward.fmul(liqProtocolFee);
            IERC20(payToken).safeTransfer(receipt, liqReward.sub(fee));
            // 剩下的钱 给协议费率接受人
            IERC20(payToken).safeTransfer(protocolReceipt, fee);
        } else {
            if (payTokenBalance < liqReward) {
                liqReward = payTokenBalance;
            }
            IERC20(payToken).safeTransfer(receipt, liqReward);
        }

        emit Liquidate(index, receipt, tmpLp, receivePosition, liqPrice, fee);

        delete positions[index];
    }

    function liqPrice(uint32 index) external view returns (uint256) {
        Position memory p = positions[index];
        require(p.asset > 0, "non-exist position");
        (uint256 liqPrice, ) = _calLiqPrice(p);
        return liqPrice;
    }

    function _calLiqPrice(Position memory p) internal view returns (uint256 liqPrice, uint256 margin) {

        margin = p.asset.div(p.level > 0? uint256(int256(p.level)): uint256(int256(-p.level)));
        uint256 receivePosition = p.asset.sub(margin.fmul(1e18 - marginRatio));

        if (p.level > 0) {

            uint256 minuend = p.lp.fdiv(p.openPrice).fdiv(receivePosition).fmul(totalPosition).add(
                mergedShort.openLp.fdiv(mergedShort.openPrice)
            );
            uint256 subtraction = mergedLong.openLp.fdiv(mergedLong.openPrice);
            if (minuend > subtraction) {
                if (mergedShort.lp == 0) {
                    liqPrice = MAX_UINT256;
                } else {
                    liqPrice = mergedShort.lp.mul(2).fdiv(minuend.sub(subtraction));
                }

            } else {
                liqPrice = 0;
            }

        } else {

            uint256 minuend = mergedLong.openLp.fdiv(mergedLong.openPrice);
            uint256 subtraction = mergedShort.openLp.fdiv(mergedShort.openPrice);
            int256 denominator;
            if (minuend > subtraction) {
                denominator = int256(p.lp.fdiv(p.openPrice).add(
                        receivePosition.fdiv(totalPosition).fmul(minuend - subtraction)
                    )
                );
            } else {
                denominator = int256(p.lp.fdiv(p.openPrice)) -  int256(
                    receivePosition.fdiv(totalPosition).fmul(subtraction - minuend)
                );
            }

            int256 numerator = int256(p.lp.mul(2)) - int256(
                receivePosition.fdiv(totalPosition).fmul(mergedShort.lp).mul(2)
            );

            if ( (denominator > 0) != (numerator > 0) ) {
                liqPrice = 0;
            } else {
                liqPrice = uint256(numerator*E18/denominator);
            }
        }

        return (liqPrice, margin);
    }

    function _rebase(uint256 tmpPrice) internal {
        if (lastPrice == tmpPrice) {
            return;
        }

        lastPrice = tmpPrice;

        if (mergedLong.asset == 0) {
            mergedLong.lp = 0;
        } else {
            mergedLong.lp = tmpPrice.fdiv(mergedLong.openPrice).fmul(mergedLong.openLp);
        }

        if (mergedShort.asset == 0) {
            mergedShort.fakeLp = 0;
            mergedShort.lp = 0;
        } else {
            mergedShort.fakeLp = tmpPrice.fdiv(mergedShort.openPrice).fmul(mergedShort.openLp);
        }

        emit Rebase(tmpPrice, mergedLong.lp, mergedShort.fakeLp);
    }

    function setEndPrice() external onlyOwner {
        endPrice = IPrice(_priceAddr).getPriceAndUpdate();
    }

    function setMarginRatio(uint256 marginRatio_) external onlyOwner {
        marginRatio = marginRatio_;
        emit SetMarginRatio(marginRatio_);
    }

    function setProtocolReceipt(address protocolReceipt_) external onlyOwner {
        protocolReceipt = protocolReceipt_;
    }

    modifier lock() {
        require(!locked, 'LOCK');
        locked = true;
        _;
        locked = false;
    }

    modifier onlyDealer(address user) {
        require(Dealer(dealer).ownerOf(id) == user, "not Dealer");
        _;
    }

    modifier onlyPlayer(address user) {
        require(Player(player).balanceOf(user, Player(player).dealerToPlayer(id)) > 0, 'you are not this pool player');
        _;
    }
}
